import React from 'react';
import UsersService from '../services/UsersService';

import Nav from './nav'


class Home extends React.Component {

    componentDidMount() {

        UsersService.getUsers('users').then(
            res => {
                this.setState({users: res.data})

            },
            err => {
                console.log(err);
            }
        )
    }

    render() {
        document.body.style = 'background: linear-gradient(180deg, rgba(65,65,65,0.8939950980392157) 0%, rgba(125,121,255,0.8939950980392157) 45%);';
        return (
            <div>
                <Nav/>
                <h2>You are not logged in</h2>
            </div>
        )        
    }
}

export default Home;
